import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Route,
  Redirect,
} from 'react-router-dom';
import './App.css';
import Header from './components/header';
import Login from './components/login';

const App = () => {
  return (
    <Router>
      <Switch>
        <div className="App">
          <Header />
        <Route path={'/login'} exact>
          <Login />
        </Route>
        <Route path={'*'}>
          <div className="App">
            404 Error
          </div>
        </Route>
      </div>
      </Switch>
    </Router>
  );
}

export default App;
